import base64
import gzip
import io


data = """"""  # 종철님이 보여주신 긴 문자열

decoded = base64.b64decode(data)

# gzip 헤더(1f8b08) 위치 찾기
idx = decoded.find(b'\x1f\x8b\x08')
if idx != -1:
    gzipped = decoded[idx:]  # gzip 헤더부터 잘라내기
    with gzip.GzipFile(fileobj=io.BytesIO(gzipped)) as f:
        uncompressed = f.read()
    print(uncompressed.decode('utf-8', errors='ignore'))
else:
    print("gzip 헤더를 찾을 수 없습니다.")
